import React from "react";
import { styled } from "styled-components";
import { primaryColor, primaryColorSuperLight } from "../components/colors";
import Crypto from "../components/Crypto";

const Title = styled.h1`
  text-align: center;
  color: ${primaryColor};
  text-transform: capitalize;
`;

const Wrapper = styled.div`
  width: 80%;
  padding: 1rem;
  margin: 0 auto;
  background-color: ${primaryColorSuperLight};
  border-radius: 20px;
  overflow: hidden;
  box-shadow: 0px 0px 5px 1px #cccccc;
`;
const Info = styled.div`
  display: flex;
  color: #8d8d8d;
  div {
    width: 25%;
    text-align: center;
  }
`;

function LandingPage() {
  const [topTenCryptos, setTopTenCryptos] = useState([]);

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => {
        setTopTenCryptos(data);
      });
  }, []);
  console.log(topTenCryptos);
  return (
    <>
      <Title>Top ten Cryptocurrencies</Title>
      <Wrapper>
        <Info>
          <div>Name :</div>
          <div>Price : </div>
          <div>Change (24H) :</div>
          <div>More Option :</div>
        </Info>
        <Crypto
          fullName="Bitcoin"
          ticker="BTC"
          price="2000$"
          change="0.01%"
          logo="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/800px-Bitcoin.svg.png"
        />
        <Crypto
          fullName="Bitcoin"
          ticker="BTC"
          price="2000$"
          change="0.01%"
          logo="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/800px-Bitcoin.svg.png"
        />
        <Crypto
          fullName="Bitcoin"
          ticker="BTC"
          price="2000$"
          change="0.01%"
          logo="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/800px-Bitcoin.svg.png"
        />
        <Crypto
          fullName="Bitcoin"
          ticker="BTC"
          price="2000$"
          change="0.01%"
          logo="https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/800px-Bitcoin.svg.png"
        />
      </Wrapper>
    </>
  );
}

export default LandingPage;
